  "text" : "7. \uC790\uB8CC\uB97C \uC62C\uB9AC\uAE30\uAC00 \uC88B\uC2B5\uB2C8\uB2E4. \uC720\uD29C\uBE0C \uBBF8\uB9AC\uBCF4\uAE30\uB3C4 \uC81C\uACF5\uD558\uACE0 \uC788\uC73C\uBA70 \uCCA8\uBD80\uD30C\uC77C\uC744 \uD1B5\uD574 \uC790\uB8CC\uB97C \uC62C\uB9B4 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uBB34\uC5C7\uBCF4\uB2E4 \uD074\uB77C\uC6B0\uB4DC\uC640 \uC5F0\uB3D9\uD558\uC5EC \uC790\uB8CC\uB97C \uC62C\uB9AC\uAE30\uAC00 \uC27D\uACE0 \uD3B8\uD569\uB2C8\uB2E4. \uAD6C\uAE00\uB4DC\uB77C\uC774\uBE0C\uC758 \uACBD\uC6B0 \uAC8C\uC2DC\uBB3C \uB9C1\uD06C\uB97C \uD558\uBA74 \uC790\uB8CC\uBA85\uC774 \uC62C\uB77C\uAC11\uB2C8\uB2E4.",
