  "text" : "6. \uC18C\uB140\uC2DC\uB300\uC640 \uAD00\uB828\uB41C \uC624\uD53C\uC15C, \uB2E4\uC591\uD55C \uC790\uB8CC(TV, \uB77C\uB514\uC624 \uD3EC\uD568) \uD53C\uB4DC\uB97C \uB04C\uC5B4 \uC62C\uB824\uC904 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC790\uB3D9\uC73C\uB85C \uCC44\uB110\uC5D0 \uC62C\uB77C\uAC11\uB2C8\uB2E4. \uD2B8\uC704\uD130 \uACC4\uC815\uC744 \uB04C\uC5B4\uC62C\uB9B4 \uC218\uB3C4 \uC788\uACE0 \uD0A4\uC6CC\uB4DC\uB85C \uB04C\uC5B4\uC62C\uB9B4 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \uD544\uD130\uB9C1 \uD558\uC5EC \uD32C\uC9C8\uC744 \uD560 \uC218\uAC00 \uC788\uC2B5\uB2C8\uB2E4.",
