  "text" : "4. \uC2AC\uB799\uC740 \uB2E4\uC591\uD55C \uC6B4\uC601\uCCB4\uC81C\uB97C \uC9C0\uC6D0\uD569\uB2C8\uB2E4. \uC708\uB3C4\uC6B0, \uB9E5, iOS, \uC548\uB4DC\uB85C\uC774\uB4DC\uB97C \uBAA8\uB450 \uC9C0\uC6D0\uD569\uB2C8\uB2E4. \uC77C\uBD80 \uCEE4\uBBA4\uB2C8\uD2F0\uAC00 \uBAA8\uBC14\uC77C\uC5D0 \uB300\uC751\uD558\uC9C0 \uC54A\uC740 \uAC83\uC5D0 \uBE44\uD574 \uC774\uB294 \uAC15\uB825\uD55C \uC7A5\uC810\uC785\uB2C8\uB2E4. \uBAA8\uBC14\uC77C \uAE30\uAE30\uB85C \uC811\uC18D \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \u2605 '\uC811\uADFC\uC131' \uB6F0\uC5B4\uB0A9\uB2C8\uB2E4.",
